import "../../../src/App.css";
import React, { useContext } from "react";
import ProductItem from "../../components/mainpages/utils/productItem/ProductItem";
import { GlobalState } from "../../GlobalState";
import "../../pages/Products/Products.css";
import Divider from "@mui/material/Divider";
// import CategoriesProducts from "./CategoriesProducts";
// import CakeIcon from "@mui/icons-material/Cake";
// import IconButton from "@mui/material/IconButton";
import { Link } from "react-router-dom";

export const Products = () => {
  const state = useContext(GlobalState);
  const [products] = state.productsApi.products;
  // console.log(products)
  // console.log(state)
  return (
    <>
      {/* <CategoriesProducts /> */}
      <div className="categoriasContainer">
        <div className="categoria1">
          <Link className="Link" to="/" aria-label="Torta">
            Torta
            <i className="fas fa-pie"></i>
          </Link>
        </div>
        <div className="categoria2">
          {" "}
          <Link className="Link" to="/" aria-label="Torta">
            Torta
            <i className="fas fa-pie"></i>
          </Link>
        </div>
        <div className="categoria3">
          {" "}
          <Link className="Link" to="/" aria-label="Torta">
            Torta
            <i className="fas fa-pie"></i>
          </Link>
        </div>
        <div className="categoria4">
          {" "}
          <Link className="Link" to="/" aria-label="Torta">
            Torta
            <i className="fas fa-pie"></i>
          </Link>
        </div>
        <div className="categoria5">
          {" "}
          <Link className="Link" to="/" aria-label="Torta">
            Torta
            <i className="fas fa-pie"></i>
          </Link>
        </div>
      </div>

      <Divider variant="middle" />
      <div className="container_prod_filt">
        <div className="container_filt">
          <div className="Filtros"> Filtros </div>
          <div className="Categorias"> Categorias</div>
          <div className="Rango de precio"> Rango de precio </div>
          <div className="Puntuacion"> Puntuacion </div>
          <div className="Oferta"> Oferta</div>
        </div>
        <div className="container-prod">
          <h1 className="namePage"> Productos </h1>
          <div>⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀ </div>
          {/* <Divider variant="middle" /> */}

          <div className="products">
            {products.map((product) => {
              return <ProductItem key={product._id} product={product} />;
            })}
          </div>
        </div>
      </div>
      {/* {products.length === 0 && <Loading />} */}
    </>
  );
};
